import React from "react";
import Form from "./Form";
import Table from "./Table";

function Card(props) {
    let calculations = {};

    const saveYearlyDataHandler = (enteredYearlyData) => {
        calculations = {
          ...enteredYearlyData,
        };
      };
    return (
        <div>
        <Form onSaveYearlyData={saveYearlyDataHandler} /> 
        
        <Table calculations={calculations}/>
    </div>
    )
}

export default Card;
